import React from "react";
import styled from "styled-components";

const SemesterBlock = ({ text }) => {
  return (
    <SemesterDiv>
      <SemesterTop>{text.title}</SemesterTop>
      <SemesterBottom>
        <SemesterCheck>
          <i class="fa-solid fa-check"></i>
        </SemesterCheck>
        <SemesterCourses>{text.courses}</SemesterCourses>
      </SemesterBottom>
    </SemesterDiv>
  );
};

export default SemesterBlock;

const SemesterTop = styled.div``;
const SemesterBottom = styled.div``;
const SemesterCheck = styled.div``;
const Semester = styled.div``;
